version: '3.3'
services:
  portainer:
    image: portainer/portainer-ce:latest
    container_name: portainer
    restart: always
    ports:
    - 8000:9000
    volumes:
    - /var/run/docker.sock:/var/run/docker.sock
    - portainer_data:/data
    networks:
    - mewbie_network
    deploy:
      placement:
        constraints:
        - node.role == manager
  MewbieClient:
    image: mewbieregistry.com:5000/mewbie_img:latest
    container_name: mewbie_client
    volumes:
    - ./enrichment_runs/dmix1_pg_heavy/all_trace_packets.json:/app/all_trace_packets.json
    - ./deployment_files/mewbie_client/mewbie_client.py:/app/mewbie_client.py
    - ritul_logs:/app/logs/
    environment:
    - CONTAINER_NAME=mewbie_client
    - WORKLOAD_NAME=dmix1_pg_heavy
    command: sh -c "tail -f /dev/null"
    networks:
    - mewbie_network
    deploy:
      placement:
        constraints:
        - node.role == manager
  MongoDB-0_n6268:
